        //Listas Administrador
        public DataSet ListaServiciosPendientes()
        {
            return this.EjecutarConsulta("SELECT a.p_Id_servicio_mecanizado AS Codigo, c.Nombre+' '+c.Apellido AS Solicitante, a.p_Fecha AS Fecha, " +
                "CASE WHEN a.p_Prioridad = 1 THEN 'Urgente' WHEN a.p_Prioridad = 2 THEN 'Importante' WHEN a.p_Prioridad = 3 THEN 'Repuesto'" +
                "Else 'Otro' END AS Prioridad," +
                "b.p_Nombre AS Producto, a.p_Cantidad AS Cantidad, a.p_Cantidad_pendiente as CantidadPend, a.p_Fecha_Finalizacion as Fecha_final FROM tblServicioMecanizado a " +
                "INNER JOIN tblCatalogoProductos b ON a.p_Producto = b.p_Id_producto " +
                "INNER JOIN Empleados.dbo.tblEmpleados c ON a.p_Id_solicitante = c.EmpleadoId WHERE a.p_Estado = '0'");
        }
