        public DataSet BuscarServicio(int IdServicio)
        {
            return EjecutarConsulta("select a.p_Id_servicio_mecanizado, b.Nombre+' '+b.Apellido AS p_Id_solicitante, a.p_Fecha, a.p_Centro_trabajo, " +
                "CASE WHEN a.p_Prioridad = 1 THEN 'Urgente' WHEN a.p_Prioridad = 2 THEN 'Importante' " +
                "WHEN a.p_Prioridad = 3 THEN 'Repuesto' Else 'Otro' END AS p_prioridad, c.p_Nombre as p_Producto, a.p_Descripcion, " +
                "a.p_Cantidad, a.p_Muestra_img, a.p_Plano_img, a.p_Material, a.p_Dureza, a.p_Otros, a.p_Fecha_Finalizacion, " +
                "CASE WHEN a.p_Estado = 0 THEN 'Pendiente' WHEN a.p_Estado = 1 THEN 'En proceso' WHEN a.p_Estado = 2 THEN 'Parcial' " +
                "WHEN a.p_Estado = 3 THEN 'Finalizado' Else 'Pendiente' END AS p_estado, a.p_Id_empleado, " +
                "a.p_Cantidad_pendiente from tblServicioMecanizado a INNER JOIN Empleados.dbo.tblEmpleados b ON a.p_Id_solicitante = b.EmpleadoId " +
                "INNER JOIN tblCatalogoProductos c ON a.p_Producto = c.p_Id_producto WHERE p_Id_servicio_mecanizado = " + IdServicio);
        }
        //ReportesAdmin
        public DataSet ReporteFechas(DateTime _fechaInicial, DateTime _fechaFinal)
        {
            return EjecutarConsulta("select a.p_Id_servicio_mecanizado as Codigo, b.Nombre+' '+b.Apellido AS Solicitante, " +
                "a.p_Fecha as Fecha, a.p_Centro_trabajo as Centro_de_trabajo, " +
                "CASE WHEN a.p_Prioridad = 1 THEN 'Urgente' WHEN a.p_Prioridad = 2 THEN 'Importante' " +
                "WHEN a.p_Prioridad = 3 THEN 'Repuesto' Else 'Otro' END AS Prioridad, c.p_Nombre as Producto, " +
                "a.p_Cantidad as Cantidad, a.p_Fecha_Finalizacion as Finalizacion, " +
                "CASE WHEN a.p_Estado = 0 THEN 'Pendiente' WHEN a.p_Estado = 1 THEN 'En proceso' WHEN a.p_Estado = 2 THEN 'Parcial' " +
                "WHEN a.p_Estado = 3 THEN 'Finalizado' Else 'Pendiente' END AS Estado " +
                "from tblServicioMecanizado a INNER JOIN Empleados.dbo.tblEmpleados b ON a.p_Id_solicitante = b.EmpleadoId " +
                "INNER JOIN tblCatalogoProductos c ON a.p_Producto = c.p_Id_producto " +
                "WHERE a.p_Fecha BETWEEN '" + _fechaInicial + "' AND '" + _fechaFinal + "'");
        }
